import React from 'react'
import ReactDOM from 'react-dom'
import { HashRouter, Route, Switch } from 'react-router-dom' // 引入路由

// 引入redux
// import { Provider } from 'react-redux'
// import store from './redux/store'

import './index.css'
// import Example from './components/Example'

import TeacherHome from './components/teacherHome/teacherHome'
import StudentHome from './components/studentHome/studentHome'
// Uncomment below two lines to enable PWA
// import registerServiceWorker from './register-service-worker'
// registerServiceWorker()

ReactDOM.render(
  <div>
      <HashRouter>
        <Switch>
          <Route path="/studentHome" component={StudentHome} /> {/* 学生界面 */}
          <Route component={TeacherHome} /> {/* 默认组件：老师界面*/}
        </Switch>
      </HashRouter>
  </div>,
  document.getElementById('root'),
)
